import React, { useState, useEffect } from "react";
import { Container, Row, Col } from "react-flexa";
import "./warehousestyle.css";

function WarehouseTable() {
  const [warehouses, setWarehouses] = useState([]);

  useEffect(() => {
    // fetch data from the database
    fetch("/warehouse")
      .then((response) => response.json())
      .then((data) => setWarehouses(data))
      .catch((error) => console.log(error));
  }, []);

  return (
    <Container className="warehouse-table-container">
      {/* Add a class */}
      <Row>
        <Col xs={4} className="warehouse-table-header">
          Warehouse Name
        </Col>{" "}
        {/* Add a class */}
        <Col xs={4} className="warehouse-table-header">
          Max Stock Amount
        </Col>{" "}
        {/* Add a class */}
        <Col xs={4} className="warehouse-table-header">
          Client
        </Col>{" "}
        {/* Add a class */}
      </Row>
      {warehouses.map((warehouse) => (
        <Row key={warehouse.id} className="warehouse-table-row">
          {" "}
          {/* Add a class */}
          <Col xs={4}>{warehouse.warehouseName}</Col>
          <Col xs={4}>{warehouse.maxStockAmount}</Col>
          <Col xs={4}>{warehouse.clientID}</Col>
        </Row>
      ))}
    </Container>
  );
}

export default WarehouseTable;
